// RegisterPage.js
import React, { useState } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from '../Components/Header';
import NavigationBar from '../Components/NavigationBar';
import { Link } from 'react-router-dom';
import Footer from '../Components/Footer';


const RegisterPage = () => {
    const [formData, setFormData] = useState({
      name: '',
      registrationNumber: '',
      contactNumber: '',
      email: '',
      batch: '',
      specialization: '',
      role: '',
    });
  
    const handleChange = (e) => {
      setFormData({ ...formData, [e.target.name]: e.target.value });
    };
  
    const handleSubmit = async (e) => {
      e.preventDefault();
      try {
        await axios.post('/register', formData);
        // Redirect or show success message
      } catch (error) {
        console.error(error);
        // Handle registration error
      }
    };
  
    return (
      <div>
        <h2>Student Registration Form</h2>
        <form onSubmit={handleSubmit}>
          <div>
            <label htmlFor="name">Name:</label>
            <input type="text" id="name" name="name" value={formData.name} onChange={handleChange} />
          </div>
          <div>
            <label htmlFor="registrationNumber">Registration Number:</label>
            <input type="text" id="registrationNumber" name="registrationNumber" value={formData.registrationNumber} onChange={handleChange} />
          </div>
          <div>
            <label htmlFor="contactNumber">Contact Number:</label>
            <input type="text" id="contactNumber" name="contactNumber" value={formData.contactNumber} onChange={handleChange} />
          </div>
          <div>
            <label htmlFor="email">Email Address:</label>
            <input type="email" id="email" name="email" value={formData.email} onChange={handleChange} />
          </div>
          <div>
            <label htmlFor="batch">Batch:</label>
            <select id="batch" name="batch" value={formData.batch} onChange={handleChange}>
              <option value="">Select Batch</option>
              <option value="regular">Regular</option>
              <option value="june">June</option>
            </select>
          </div>
          <div>
            <label htmlFor="specialization">Specialization:</label>
            <select id="specialization" name="specialization" value={formData.specialization} onChange={handleChange}>
              <option value="">Select Specialization</option>
              <option value="IT">Information Technology (IT)</option>
              <option value="SE">Software Engineering (SE)</option>
              <option value="IS">Information Systems (IS)</option>
              <option value="CS">Cyber Security (CS)</option>
              <option value="DS">Data Science (DS)</option>
              <option value="CSNE">Computer Systems and Network Engineering (CSNE)</option>
            </select>
          </div>
          <button type="submit">Register</button>
        </form>
      </div>
    );
  };
  
  export default RegisterPage;
